    if(p==null || isNaN(p)) return '';
    return (Math.round(p*1000)/10).toFixed(1) + '%';
  }
  function render(items){
    elResults.innerHTML='';
    if(!items.length){ elEmpty.style.display='block'; return; } else { elEmpty.style.display='none'; }
    for(const it of items){
      const card=document.createElement('div');
      card.className='card';
      card.innerHTML=`

        </div>`;
      elResults.appendChild(card);

  }
function search() {
  const q = (prefixInput.value || '').trim().toUpperCase();
  const items = DATA.filter(r => (r.prefix || '').toUpperCase().startsWith(q));
  render(items); // <-- no slice; shows all matches
}
